import React from 'react';
import Form from './Components/Form';
import Box from './Components/Box';

import './App.css';

function App() {
  const[boxes, setState] = useState([]);
  return (
    <div className="App">
      <Form inputs={boxes}/>
      <Box />
    </div>
  );
}

export default App;
